    const targetValue = 49.6
    const duration = 1400 // Animation duration in milliseconds
    const steps = 10 // Number of steps in the animation
    const stepValue = targetValue / steps
    let currentStep = 0

    const timer = setInterval(() => {
      if (currentStep < steps) {
        setCount((prev) =>
          Math.min(parseFloat((prev + stepValue).toFixed(1)), targetValue)
        )
        currentStep++
      } else {
        clearInterval(timer)
      }
    }, duration / steps)

